"use strict";var username=$.getUrlParam("username");$.ajax({url:"/editUser",data:{username:username},async:!0,cache:!1,type:"POST",dataType:"text",success:function(e){if(e){var a=JSON.parse(e)[0],s=a.id,r=a.username,t=a.password;$("#id").html(s),$("#username").html(r),$("#password").val(t)}else alert("数据传输有错误！")}}),$("#confirmUser").click(function(){$.ajax({url:"/updateUser",data:{username:username,password:$("#password").val()},async:!0,cache:!1,type:"POST",dataType:"text",success:function(e){"true"==e?(alert("修改成功"),location.href="/users"):alert("数据传输有错误!")}})});